import React from 'react';
import { Box, Text } from '@chakra-ui/react';

import Header from '../Components/Header';

const Teaching = props => {
  return (
    <Box {...props} h="auto" pb="20" w="100%">
      <Header
        title="Teaching and Course Development"
        description="Leadership"
      />
      <Text>
        Currently, I'm one of the head TAs for CSE 14x, the introductory
        computer science series at the University of Washington.
      </Text>
    </Box>
  );
};

export default Teaching;
